import React from 'react';

// Simple test component
const App = () => {
  console.log('App component is rendering...');
  
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>Login Application</h1>
      <p>If you can see this, React is working!</p>
      <div style={{ 
        backgroundColor: '#007bff', 
        padding: '20px', 
        borderRadius: '8px',
        marginTop: '20px'
      }}>
        <h2>Test Form</h2>
        <input type="email" placeholder="Email" style={{ margin: '10px', padding: '10px' }} />
        <br />
        <input type="password" placeholder="Password" style={{ margin: '10px', padding: '10px' }} />
        <br />
        <button style={{ margin: '10px', padding: '10px 20px', backgroundColor: '#f0f0f0', color: 'red', border: 'none', borderRadius: '4px' }}>
          Sign In
        </button>
      </div>
    </div>
  );
};

export default App;
